import styled from 'styled-components';

const StyleFileIndex = styled.div`
    background-color: #121212;

    .file-view {
        padding-top: 5rem;
    }

    .box{
        background-color: #333333;
        color: #fff;
    }
    .btn-download{
        color: #fff;
        border: 1px solid white;
    }
    
`

export {StyleFileIndex};
